package com.studio.common.result;/** * description: * author:          song * createDate:      2018/1/24 */public class UploaderFile {    private String id;    private long size;    private String name;    private String path;    private String realName;    private String ext;    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public long getSize() {        return size;    }    public void setSize(long size) {        this.size = size;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getPath() {        return path;    }    public void setPath(String path) {        this.path = path;    }    public String getRealName() {        return realName;    }    public void setRealName(String realName) {        this.realName = realName;    }    public String getExt() {        return ext;    }    public void setExt(String ext) {        this.ext = ext;    }}